import React from 'react';
import { NavLink } from 'react-router-dom';
import FullTable from '../../../../../components/cryptX/tables/React/AllCoinsTable';
import MarketsMartketCapPieDonutChart from '../../../../../components/cryptX/charts/chart/MarketsMarketCapPieDonutChart.js';
import {Row, Col, Card} from 'react-bootstrap';

import axios from 'axios';

const Markets = () => {
    return (
        <React.Fragment>
            <Row>
                <Col xl={12} md={10} >
                    <MarketsMartketCapPieDonutChart></MarketsMartketCapPieDonutChart>
                </Col>
            </Row>
            <Row>
                <Col xl={12} md={10} >
                    <FullTable></FullTable>
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default Markets;
